import React, { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/getTestData").then(res => res.json()).then(data => { setData(data) }, [])
  })
  return (
    <div>
      hm irgendwas stimm nicht
      {data}
    </div>
  )
}

export default App
